import React from "react";
import NewProduct from "../home/NewProduct";
import BestSeller from '../home/BestSeller'
const Home = () => {
  return (

    <div>
      <div className="jumbotron p-5   ">
      <img src="https://static.hd.co.th/system/image_attachments/images/000/153/667/original/desktop-_herobanner-pharma.jpg" alt="banner" className="img-fluid  p-5 display-4 jumbotron" />
      
      </div>
      
      
      
      {/* New Product */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   





      {/* Best Seller */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้าขายอย่างดี
       </h4>
        <BestSeller />

    </div>
  );
};

export default Home;
